import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
const Resume = () => {
  const [resume, setResume] = useState([]);
  useEffect(() => {
    const getResume = async () => {
      const response = await axios.get("http://localhost:8080/user");
      let res = response.data.user;
      setResume(res);
    };
    getResume();
  }, []);
  return (
    <div class="container">
      <div class="section-title">
        <h2>Resume</h2>
        <p>
        I am a Node js developer with 4.5+ years of experience in node js field, working on various node js project .
        some projects are from service based company. some projects are from product based company.
        Currently working on TekSystems (HP client)as a node js developer, my database is postgresql, other technology.
        <ul>
          <li>Well-versed with AGILE Methodology, SDLC, Version control system (GIT), Defect Tracking tool (Jira)</li>
          <li>Languages: React js, Typescript, NodeJS, JavaScript, Temporal.io</li>
          <li>Database: Postgresql, Mongodb, mysql, hasura(graphql)</li>
          <li>AI/ML: tensorflow, dunfojs, NodeJS</li>
          <li>Bootsrap5, Material UI, css</li>
          <li>Other Tools: CICD, Github, jenkins, docker, amazon(ec2)</li>
        </ul>
        </p>
      </div>

      <div class="row">
        <div class="col-lg-6" data-aos="fade-up">
          <h3 class="resume-title">Sumary</h3>
          <div class="resume-item pb-0">
            <h4>Alex Smith</h4>
            <p>
              <em>
              A hard working, dedicated IT professional with
              years of experience In various NodeJS projects, 
              JavaScript, PostgreSQL, GIT,Clean Architecture.

              </em>
            </p>
            <ul>
              <li>Bengalore, India</li>
              <li>(123) 456-7891</li>
              <li>anweshachakraborty2021@gmail.com</li>
            </ul>
          </div>

          <h3 class="resume-title">Education</h3>
          <div class="resume-item">
            <h4>Master In Computer Application(MCA)</h4>
            <h5>2022 - 2024</h5>
            <p>
              <em>Chandigarh University</em>
            </p>
            <p>
              Persuing final year in Masters in Computer application.
            </p>
          </div>
          <div class="resume-item">
            <h4>Bachelor of Mathematics</h4>
            <h5>2011 - 2014</h5>
            <p>
              <em>Bahmananda Keshab Chandra College</em>
            </p>
            <p>
              Completed Bachelor degree in Mathematics(HONS)
            </p>
          </div>
        </div>
        <div class="col-lg-6" data-aos="fade-up" data-aos-delay="100">
          <h3 class="resume-title">Professional Experience</h3>
          {resume.map((val) => {
            return (
              <>
                <div class="resume-item">
                  <h4>{val.designation}</h4>
                  <h5>{val.duration}</h5>
                  <p>
                    <em>{val.company}, {val.location}</em>
                  </p>
                  <ul>
                    {val.companies.map((vals) => {
                      return (
                        <li>
                          {vals.description}
                        </li>
                      );
                    })}
                  </ul>
                </div>
              </>
            );
          })}
        </div>
      </div>
    </div>
  );
};
export default Resume;
